const navbarStyles = {
  nav: {
    display: "flex",
    justifyContent: "space-between",
    alignItems: "center",
    padding: "20px",
    backgroundColor: "#333",
    color: "#fff"
  },
  logo: {
    height: "100px",
    marginRight: "auto"
  },
  navLink: {
    color: "#fff",
    fontWeight: "bold",
    marginRight: "20px"
  },
  navBtn: {
    backgroundColor: "#fff",
    color: "#333",
    padding: "10px 20px",
    border: "none",
    borderRadius: "4px",
    cursor: "pointer"
  },
  navCloseBtn: {
    backgroundColor: "transparent",
    border: "none",
    color: "#fff",
    fontSize: "24px",
    cursor: "pointer"
  }
};

export default navbarStyles;
